import {
    GET_DATA
  } from "../types";

  const initialState = {
    loading: false,
    searchInfo: {},
  };

  //depending on the action type we receive, we will do something
  export default function (state = initialState, action) {
    switch (action.type) {
      /*catch action type */
      case GET_DATA:
        return {
          ...state,
          searchInfo: action.payload,
        };
      default:
        return state;
    }
  }
